import { View, Text, Button, StyleSheet} from 'react-native'
import React from 'react'

const StandardButton = ({title, onPress}) => {
  return (
    <Button 
        title={title}
        onPress={onPress}
        style={{backgroundColor: "red"}}
    />
  )
}

const styles = StyleSheet.create({
    button: {
        width: "50%",
        backgroundColor: "red"
    }
})




export default StandardButton
